import '../css/Home.css';
import React, { useEffect } from 'react';

function Home() {
    useEffect(() => {
        const textHome = "@users/MyronTruesdale: Home";
        let index = 0;
        const speed = 100; // Typing speed in milliseconds

        function typeWriter() {
            if (index < textHome.length) {
                let element = document.getElementById("typeHome");
                if(element) {
                    element.innerHTML += textHome.charAt(index);
                    index++;
                    setTimeout(typeWriter, speed);
                }
            }
        }

        typeWriter();
    }, []); // Empty array ensures this effect runs once after initial render

    return (
        <div>
            <div id="title">
                <h1 id="typeHome"></h1>
            </div>
            <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
        </div>
    );
}

export default Home;
